import React from 'react';

const AboutPage = () => {
  return (
    <div className="search-result">
      <h2 className="search-result-title">About Jonathan Pan - Google Search</h2>
      <div className="search-result-link-container">
      </div>
      <div className="search-result-description-container">
        <p className="search-result-description">
          Jonathan Pan is a software engineer with expertise in web development and front-end technologies. He has a
          strong passion for creating innovative and user-friendly applications.
        </p>
      </div>
    </div>
  );
};

export default AboutPage;
